import React from "react";
import "../../App.css";
import "./Portfolio.css";

function Portfolio() {
  return (
    <>
      <h1 className="portfolio">Portfolio</h1>
      <h1 className="plainsight">Plain Sight</h1>
    </>
  );
}

export default Portfolio;
